description:
The Procol Harum Special

Arts Documentary with no narration published by ABC in 1970 - English language


Information
------------------------------

Procol Harum, best known for their world-wide smash hit of 1967, A Whiter Shade of Pale, are the stars of a 55-minute special program. 
In 1967 a new pop group emerged with the hit song, A Whiter Shade of Pale. They were The Procol Harum. We meet the members of the group and see them perform their hit along with other numbers, including Captain Clack, Whisky Train, and Your Overcoat Is Too Long. The group's leader, Gary Brooker, comments throughout. 
Shown on the ABC and in the UK on BBC.

Tracklist :

A Whiter Shade Of Pale
Good Captain Clack
Whiskey Train
Homburg
Piggy Pig Pig
In Held Twas In I
Pilgrims Progress
Dead Man's Dream
Nothing That I Didn't Know

